import './App.css';
import Nav from "./Nav";
import Category from "./Category";
import Product from "./Product";
import {Container, Row, Col} from 'reactstrap';
import React from "react";

function App() {
  return (
    <div className="App">
        <Container>
            <Row>
                <Nav/>
            </Row>
            <Row>
                <Col xs = "3">
                    <Category/>
                </Col>
                <Col xs = "9">
                    <Product/>
                </Col>
            </Row>
        </Container>
    </div>
  );
}

export default App;
